llm_output:
function transfer(address recipient, uint256 amount) public {
    require(recipient != address(0), "ERC20: transfer to the zero address");
    require(amount > 0, "ERC20: transfer amount must be greater than zero");
    require(tradingActive, "Trading is not active.");

    address sender = msg.sender;
    uint256 senderBalance = balanceOf(sender);
    require(senderBalance >= amount, "ERC20: transfer amount exceeds balance");

    if (limitsInEffect) {
        if (!isExcludedFromFees[sender] && !isExcludedFromFees[recipient]) {
            require(amount <= maxTransactionAmount, "Transfer amount exceeds the maxTransactionAmount.");
            if (automatedMarketMakerPairs[recipient]) {
                require(amount <= maxWallet, "Transfer amount exceeds the maxWallet.");
            }
        }
    }

    if (transferDelayEnabled) {
        require(block.number > lastTransferBlock[sender], "_transfer:: Transfer Delay enabled. Only one purchase per block allowed.");
        lastTransferBlock[sender] = block.number;
    }

    _transfer(sender, recipient, amount);
}

function _transfer(address sender, address recipient, uint256 amount) internal {
    uint256 senderBalance = balanceOf(sender);
    require(senderBalance >= amount, "ERC20: transfer amount exceeds balance");
    balances[sender] = senderBalance - amount;
    balances[recipient] += amount;
    emit Transfer(sender, recipient, amount);
}

